INSERT INTO `faq` (`faqId`, `faqQuestion`, `faqAnswer`, `faqLanguage`) VALUES
(2, 'Why do you have a FAQ?', 'To answer frequently asked questions.', 'en'),
(3, 'Pourquoi avoir une FAQ?', 'Pour répondre à des question fréquemment posés.', 'fr'),
(21, 'What are you going to do with the data?', 'Use them anonymously to plot trend charts.', 'en'),
(22, 'Où fabriquons-nous les différents produit qui nous permettent de réaliser les différents tests ?&nbsp;<br>', 'Ils sont fabriqués en France et plus précisément à Issy les Moulineaux par l\'entreprise d\'AutoKapt.&nbsp', 'fr'),
(33, 'Qu\'allez vous faire des données?', 'Les utiliser anonymement pour tracer des graphiques de tendance.', 'fr'),
(35, 'L\'œuf ou la poule?', 'L\'œuf car on ne fait pas d\'omelette sans casser des poules.', 'fr'),
(37, 'Pourquoi n\'avoir mis qu\'anglais et français?', 'Parce que le français est nôtre langue maternelle et l\'anglais et la langue international.&nbsp;', 'fr'),
(38, 'Why did you only use English and French?', 'Because French is our maternel language and English is the international language.&nbsp;', 'en'),
(41, 'Where do we manufacture the different products that allow us to perform the different tests?&nbsp;', 'sf', 'en'),
(42, 'Quel est l\'objectif de ces différents tests ?&nbsp;', 'Notre objectif est d\'empêcher les personnes qui sont dangereuses pour les autres, mais avant tout pour elles-mêmes, de toucher un volant lorsque celles-ci présentent des problèmes physiques ou psychiques. Nous voulons à tout prix réduire le nombre d\'accidents routier. &nbsp;', 'fr'),
(43, 'What is the purpose of these different tests?', 'Our goal is to prevent people who are dangerous to others, but above all to themselves, from touching a steering wheel when they have physical or psychological problems. We want to reduce the number of road accidents at all costs. &nbsp;', 'en'),
(44, 'Qui sommes-nous ?', 'Fondée en 2020, Infinite Measures est une entreprise ayant pour but de concevoir un système de mesure s\'adressant à des auto-écoles pour vérifier si une personne est apte à conduire.&nbsp;', 'fr'),
(45, 'Who are we ?', 'Founded in 2020, Infinite Measures is a company that aims to develop a measurement system for driving schools to check whether a person is fit to drive.&nbsp;', 'en');
